import React from "react";

function ImagePopup(props) {
  console.log(props.isOpen);
  return (
    <div
      classname={`popup__image popup ${props.isOpen ? "popup_visible" : ""}`}
    >
      <div classname="popup__image_cont">
        <div classname="popup__image_wrap">
          <img classname="grid__image_active" alt="{props.title}" />
          <button
            type="button"
            classname="popup__close button"
            aria-label="close"
            onClick={props.onClose}
          ></button>
        </div>
        <div classname="popup__image_capt"></div>
      </div>
    </div>
  );
}

export default ImagePopup;
